4 Ekim 2019’da Bakü Haydar Aliyev Merkezinde açılan ‘Belleğin Alfabesi’ sergimiz yoğun ilgi ve sonrasında da oluşan küresel salgından dolayı 1 Eylül 2021 tarihe kadar uzatıldı.
İki yıla yayılan sergi muhtemelen dünya sanat tarihinin en uzun sergilerinden biri olarak hatırlanacak.

